import React from 'react';
import ResultImage from '../ResultImage';

function ResultItem({ handler }) {
  return (
    <li className="list-group-item">
      <ResultImage 
        src={handler(campground)}
      />
      Result Item
    </li>
  )
}

export default ResultItem;
